cy.contains('Analyzer').click();
cy.url().should('eq', `${Cypress.config().baseUrl}/`);
cy.contains('h1', 'Swing Analyzer').should('be.visible');

// Load the fixture
cy.loadPoseTrackFixture();
// Visit pose studio and verify the track appears
cy.visit('/poses');
// Should show 1 file instead of 0
cy.contains('1 files').should('be.visible');
// Should show the video name from the fixture
cy.contains('swing-sample.mp4').should('be.visible');

cy.loadPoseTrackFixture();
cy.visit('/poses');
// Check the file card shows correct info
cy.get('.file-card').within(() => {
    cy.contains('swing-sample.mp4').should('be.visible');
    cy.contains('Lightning').should('be.visible'); // movenet-lightning
    cy.contains('30 frames').should('be.visible');
    cy.contains('10.0s').should('be.visible');
});

cy.loadPoseTrackFixture();
cy.visit('/poses');
// Click the Test button
cy.contains('button', 'Test').click();
// Should show an alert with analysis results
cy.on('window:alert', (text) => {
    expect(text).to.include('Analysis Results');
    expect(text).to.include('Total Frames');
});

cy.loadPoseTrackFixture();
cy.visit('/poses');
// Should show 1 file
cy.contains('1 files').should('be.visible');
// Click delete button (the trash icon button)
cy.get('.btn-danger').click();
// Confirm the deletion
cy.on('window:confirm', () => true);
// Should now show 0 files
cy.contains('0 files').should('be.visible');
cy.contains('No saved pose tracks yet').should('be.visible');

cy.loadPoseTrackFixture();
cy.visit('/poses');
// Find download button by its SVG path (download icon)
cy.get('.file-card').within(() => {
    cy.get('button[title="Download"]').should('exist');
});

// First load a fixture
cy.loadPoseTrackFixture();
cy.visit('/poses');
cy.contains('1 files').should('be.visible');
// Clear and reload
cy.clearPoseTracks();
cy.reload();
// Should be empty
cy.contains('0 files').should('be.visible');

cy.get('#load-hardcoded-btn').click();
// Video should have a source
cy.getVideoElement()
    .should('have.prop', 'src')
    .and('include', 'swing-sample.mp4');

// Load the sample video first
cy.get('#load-hardcoded-btn').click();
// Wait for video to load
cy.getVideoElement().should('have.prop', 'readyState').and('be.gte', 2);
// The video controls might be disabled if model isn't loaded
// but we can still verify the buttons exist
cy.get('#play-pause-btn').should('exist');

// Header
cy.contains('h1', 'Swing Analyzer').should('be.visible');
// Top controls
cy.get('#load-hardcoded-btn').should('be.visible').and('contain', 'Sample');
cy.get('#camera-btn').should('be.visible').and('contain', 'Camera');
cy.get('input[type="file"]#video-upload').should('exist');
// Video container
cy.get('.video-container').should('exist');
cy.getVideoElement().should('exist');
cy.getCanvasElement().should('exist');

cy.get('#prev-frame-btn').should('exist');
cy.get('#play-pause-btn').should('exist');
cy.get('#next-frame-btn').should('exist');
cy.get('#stop-btn').should('exist');
